func threeSum(nums []int) (ans [][]int) {
	simplifyNums := make(map[int]int)
	var newNums []int
	for i := range nums {
		if count, ok := simplifyNums[nums[i]]; !ok || count < 3 {
			newNums = append(newNums, nums[i])
			simplifyNums[nums[i]]++
		}
	}
	nums = []int{}

	exist := make(map[[3]int]bool)
	for place, num := range newNums {
		twos := twoSum(newNums, -num, place)
		for _, two := range twos {
			if two != nil {
				three := append(two, num)
				sort.Ints(three)
				if !exist[[3]int{three[0], three[1], three[2]}] {
					ans = append(ans, three)
					exist[[3]int{three[0], three[1], three[2]}] = true
				}
			}
		}
	}
	return ans
}

func twoSum(nums []int, target int, skip int) (ans [][]int) {
	places := make(map[int]int)
	for i, num := range nums {
		places[num] = i
	}
	for i, num := range nums {
		if j, ok := places[target-num]; ok && j != i && i != skip && j != skip {
			ans = append(ans, []int{nums[i], nums[j]})
		}
	}
	return ans
}
